import React from 'react';
import './Article.css';

const headline = 'Rats Orchestrate Takeover of New York City';
const author = 'Bernard Mendez';

function Article() {
  return (
    <div className='article_style'>

      <div>
        <div class='img'></div>
      </div>

      <div className='headline'>
        <h3>
        <a href=''>
          {headline}
        </a>
        </h3>
        <h4>By {author}</h4>
      </div>
      <a href="https://twitter.com/bernardhmendez?ref_src=twsrc%5Etfw" class="twitter-follow-button" data-show-count="false">Follow @bernardhmendez</a><script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
    </div>
  );
}


export default Article;
